import React from 'react';
import Alert from 'react-bootstrap/Alert'

import './alertBox.css'

const AlertBox = (props) => {

  const alert = props.alert;
  console.log(`
      alert: ${alert},
    `);

return (
  <div className="alertBox">
  <Alert variant="success">
  </Alert>
  </div>
)

}

export default AlertBox;
